import React, {useState} from "react";
import './App.css';
import Car from "./Car/Car";

function App() {

    const divStyle = {
        textAlign: 'center'
    }

    const stateCar = {
        car: [
            {name: 'Ford', year: 2018},
            {name: 'Audi', year: 2016},
            {name: 'Mazda', year: 2010}
        ]
    }

    const [state, setState] = useState([
        {pageTitle: 'React components'}
    ])

    return (
        <div className="App" style={divStyle}>
            <h1>{state.pageTitle}</h1>
            <button onClick={ () => { setState() }}>Change title</button>
            <Car name={stateCar.car[0].name} year={stateCar.car[0].year}/>
            <Car name={stateCar.car[1].name} year={stateCar.car[1].year}/>
            <Car name={stateCar.car[2].name} year={stateCar.car[2].year}/>
        </div>
    );
}

export default App;
